import React, { Component } from "react";
import Layout from "../../components/Layout";
import record from "../../ethereum/record";

class recordShow extends Component {
  render() {
    return (
      <Layout>
        <h1>Your details are here!!</h1>
      </Layout>
    );
  }
}

export default recordShow;
